sys_variable_value.value:
(function execute(inputs, outputs) {

  outputs.userid = "";

  if(inputs.responseBody) {
  	var userResponse = JSON.parse(inputs.responseBody);
  	if(userResponse) {

      var reponseDetails = userResponse.values;

      if(reponseDetails.length == 1 ) {
          var sessionObject = reponseDetails[0];          
          outputs.userid = sessionObject.guid;
      }
    }
  }
})(inputs, outputs);

